import React, { useState } from "react";
import './attendence.css'
import { CircularProgressbar, buildStyles } from "react-circular-progressbar";
import "react-circular-progressbar/dist/styles.css";
import { FaUserCircle } from "react-icons/fa";
import "./leaves.css"; // Custom CSS file

const Leaves: React.FC = () => {
  return (
    <div className="leaves-container d-flex">

      {/* Main Content */}
      <main className="content flex-grow-1 p-4">
        <div className="row mb-4">
          <div className="col-md-4">
            <div className="circle-box  text-white text-center p-4">
              <CircularProgressbar
                value={75}
                text={`75%`}
                styles={buildStyles({
                  pathColor: "#007bff",
                  textColor: "#007bff",
                  trailColor: "#e6e6e6",
                })}
              />
              <p>Total Leave</p>
            </div>
          </div>
          <div className="col-md-4">
            <div className="circle-box  text-white text-center">
              <CircularProgressbar
                value={50}
                text={`50`}
                styles={buildStyles({
                  pathColor: "#ffc107",
                  textColor: "#ffc107",
                  trailColor: "#e6e6e6",
                })}
              />
              <p>Half Days</p>
            </div>
          </div>
          <div className="col-md-4">
            <div className="circle-box text-white text-center">
              <CircularProgressbar
                value={20}
                text={`20%`}
                styles={buildStyles({
                  pathColor: "#28a745",
                  textColor: "#28a745",
                  trailColor: "#e6e6e6",
                })}
              />

            </div>


          </div>
        </div>

        <div className="calendar-section">
          <div className="d-flex justify-content-between align-items-center mb-3">
            <select className="form-select w-auto">
              <option>Eid 402</option>
              {/* More options here */}
            </select>
            <select className="form-select w-auto">
              <option>Dec-Jan 2023</option>
              {/* More options here */}
            </select>
          </div>

          {/* Calendar */}
          <table className="table table-bordered calendar-table">
            <thead>
              <tr>
                <th>Member</th>
                <th>Sun</th>
                <th>Mon</th>
                <th>Tue</th>
                <th>Wed</th>
                <th>Thu</th>
                <th>Fri</th>
                <th>Sat</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Fay Hill</td>
                <td></td>
                <td>24</td>
                <td>25</td>
                <td>26</td>
                <td>27</td>
                <td className="holiday">28</td>
                <td>29</td>
              </tr>
              {/* More rows here */}
            </tbody>
          </table>
        </div>
      </main>

      {/* Right Sidebar */}
      <aside className="right-sidebar bg-light p-4">
        <h5>Upcoming Public Holidays</h5>
        <ul className="list-unstyled">
          <li>8 July, 2023 - Eid al-Adha</li>
          <li>8 July, 2023 - Eid al-Adha</li>
          <li>8 July, 2023 - Eid al-Adha</li>
          {/* More items here */}
        </ul>
      </aside>
    </div>
  );
};

export default Leaves;
